import React from "react";

function Stockwerke() {
  return (
    <div className="component-div">
      <select className="Stockwerk">
        <option value="Stockwerk 1">Stockwerk 1</option>
        <option value="Stockwerk 2">Stockwerk 2</option>
        <option value="Stockwerk 3">Stockwerk 3</option>
      </select>
    </div>
  );
}

export default Stockwerke;
